import{_ as t,o,c as r,z as e,a}from"./chunks/framework.9482e208.js";const w=JSON.parse('{"title":"§ 8.01-573 How and when claims of other persons to property tried.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/8.01-573.md","filePath":"vacode/8.01-573.md"}'),n={name:"vacode/8.01-573.md"},s=e("h1",{id:"§-8-01-573-how-and-when-claims-of-other-persons-to-property-tried",tabindex:"-1"},[a("§ 8.01-573 How and when claims of other persons to property tried. "),e("a",{class:"header-anchor",href:"#§-8-01-573-how-and-when-claims-of-other-persons-to-property-tried","aria-label":'Permalink to "§ 8.01-573 How and when claims of other persons to property tried."'},"​")],-1),i=e("p",null,"Any person may file his petition at any time before the property attached as the estate of a defendant is sold or the proceeds of sale paid to the plaintiff under the judgment, disputing the validity of the plaintiff's attachment thereon, or stating a claim thereto, or an interest in or lien on the same, under any other attachment or otherwise, and its nature, and upon giving security for cost, the court, without any other pleading, shall inquire into such claim, or, if either party demand it, impanel a jury for that purpose. If it be found that the petitioner has title to, or a lien on, or any interest in, such property, or its proceeds, the court shall make such order as may be necessary to protect his rights. The costs of such inquiry shall be paid by either party, at the discretion of the court.",-1),h=e("p",null,"Code 1950, § 8-560; 1977, c. 617.",-1),d=[s,i,h];function c(p,l,f,m,u,y){return o(),r("div",null,d)}const g=t(n,[["render",c]]);export{w as __pageData,g as default};
